import React from 'react';

function Rodape(){
    return (
        <>
            <h2> Formas de Pagamento: </h2>
            <img src="./imagens/form pagamento.jpeg" alt="forma de pagamento" width="800" height="300" />
        </>
    )
}

export default Rodape;
